import React from "react";
import ReactDOM from "react-dom";
import data from "./data";
import ''

function App() {
    return (
        <table>
            <caption><b>Курс валют</b></caption>
            <tbody>
                <tr>
                    <th>Name</th>
                    <th>Rate</th>
                </tr>

                {data.map((element, index) => {
                    return (
                        <tr key={index} >
                        <td>{element.txt}</td>
                        <td>{element.rate}</td>
                    </tr>
                    )
                    })}

            </tbody>
        </table>)
}
ReactDOM.render(<App />, document.getElementById("body"));
